import * as r from "react";
import e from "../lib/SSRBase.es.js";
import m from "../defs/Star.es.js";
const t = r.forwardRef((o, a) => /* @__PURE__ */ r.createElement(e, { ref: a, ...o, weights: m }));
t.displayName = "StarIcon";
const f = t;
export {
  f as Star,
  t as StarIcon
};
